import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const ChatbotScreen = () => {
  return (
    <View>
      <Text>ChatbotScreen</Text>
    </View>
  )
}

export default ChatbotScreen

const styles = StyleSheet.create({})
